import React from 'react';
import styled from 'styled-components';

const Navbar = () => {
    return (
        <header>
            <NavContainer>

            </NavContainer>
        </header>
    )
}

export default Navbar;

const NavContainer = styled.div`
    display: grid;
    grid-template-columns: auto 1200px auto;
    background: #49B4FF;
`
